export const compareTrades = (internalTrade, externalTrade) => {
  if (!internalTrade || !externalTrade) return null

  const discrepancies = {
    price: internalTrade.price !== externalTrade.price,
    quantity: internalTrade.quantity !== externalTrade.quantity,
    settlementDate: internalTrade.settlementDate !== externalTrade.settlementDate,
    hasDiscrepancy: false
  }

  discrepancies.hasDiscrepancy = Object.entries(discrepancies)
    .filter(([key]) => key !== 'hasDiscrepancy')
    .some(([_, value]) => value)

  return discrepancies
}

export const findMatchingTrade = (internalTrade, externalTrades) => {
  return externalTrades.find(extTrade => 
    extTrade.tradeId === internalTrade.tradeId ||
    (extTrade.securitySymbol === internalTrade.securitySymbol && 
     extTrade.tradeDate === internalTrade.tradeDate)
  )
}
